window.bookSummaryJSON = "<p>I created him. Put him back together when he was nothing but ripped muscle and snapped bones.<br> I made him stronger. Faster. Lethal. I molded him into a weapon. And for three years, I controlled his every breath.</p> <p>He hates me for it. I hate him, too.</p> <p>When I was weak and desperate and thought I would die, he was the one who came for me.</p> <p>He claimed my freedom to save my life, and I am no longer the one in control.</p> <p>Now, he is my unwilling protector, and I belong to him.</p> <p>This is part two of the Protector serial. Make sure you listen to part one—<i>Protector: Rage</i>—first.</p>"; 
